<!DOCTYPE html>
<html lang="ro">
<head>
<meta charset="utf-8"/>
<meta name="viewport" content="width=device-width, initial-scale=1"/>
<title>Camera Secretă – Cheile Iubirii</title>
<style>
:root{--bg:#0f1226;--card:#141938;--accent:#9d7dff;--ok:#41d695;--bad:#ff6b6b;--text:#e9ecff}
*{box-sizing:border-box}
body{margin:0;min-height:100vh;display:flex;align-items:center;justify-content:center;background:radial-gradient(1200px 600px at 20% -10%, #242b60 0, transparent 60%),radial-gradient(900px 500px at 120% 110%, #1c224f 0, transparent 60%),var(--bg);color:var(--text);font-family:system-ui,-apple-system,Segoe UI,Roboto,Inter,sans-serif}
.wrap{width:min(860px,94vw);padding:18px}
.card{background:linear-gradient(180deg,rgba(255,255,255,.06),rgba(255,255,255,.02));border:1px solid rgba(255,255,255,.1);border-radius:18px;padding:24px 22px;box-shadow:0 10px 30px rgba(0,0,0,.35);backdrop-filter:blur(8px)}
h1{margin:0 0 6px;font-size:clamp(24px,4vw,34px)}
p{margin:0 0 12px;opacity:.92}
.stage{margin:16px 0 0}
.stage h2{margin:6px 0 8px;font-size:clamp(18px,3.6vw,24px)}
.badge{display:inline-block;padding:6px 10px;border-radius:999px;background:#2a2f66;border:1px solid rgba(255,255,255,.12);font-weight:700;font-size:12px;letter-spacing:.3px;margin-bottom:8px}
.row{display:flex;gap:10px;align-items:stretch;margin:10px 0 4px}
input{flex:1;padding:12px 14px;border-radius:12px;border:1px solid rgba(255,255,255,.12);background:#0e1230;color:#fff;font-size:16px;letter-spacing:2px;outline:none}
button{padding:12px 16px;border-radius:12px;border:0;cursor:pointer;background:linear-gradient(135deg,var(--accent),#6f54ff);color:#fff;font-weight:700;box-shadow:0 6px 16px rgba(109,89,255,.35)}
button.secondary{background:#2a2f66;border:1px solid rgba(255,255,255,.14);box-shadow:none}
.msg{margin-top:8px;font-weight:700}
.ok{color:var(--ok)} .bad{color:var(--bad)}
.hint{font-size:13px;opacity:.75}
.reward{margin:14px 0 6px;display:grid;gap:12px}
.reward a{color:#fff;background:#2a2f66;padding:12px 14px;border-radius:10px;text-decoration:none;border:1px solid rgba(255,255,255,.12);text-align:center;font-weight:700}
.reward img, .reward video{max-width:100%;border-radius:12px;border:1px solid rgba(255,255,255,.2)}
.progress{display:flex;gap:8px;margin:8px 0 4px;flex-wrap:wrap}
.dot{width:10px;height:10px;border-radius:50%;background:#3a407a;opacity:.6}
.dot.done{background:var(--ok);opacity:1}
.divider{height:1px;background:linear-gradient(90deg,transparent,rgba(255,255,255,.2),transparent);margin:16px 0}
footer{margin-top:10px;font-size:12px;opacity:.6;text-align:center}
.confetti{position:fixed;inset:0;pointer-events:none;overflow:hidden}
</style>
</head>
<body>
<div class="wrap">
  <div class="card">
    <h1>Camera Secretă 🔒</h1>
    <p>Rezolvă pe rând enigmele. Fiecare <b>cod</b> deblochează o surpriză nouă. (Nu contează literele mari/mici și spațiile.)</p>

    <div class="progress" id="progress"></div>
    <div class="divider"></div>

    <div id="stage" class="stage"></div>

    <footer>Cheile Iubirii • Progresul se salvează automat pe acest dispozitiv</footer>
  </div>
</div>
<div class="confetti" id="confetti"></div>

  { 
    title: "Enigma 3 – Cufărul final",
    hint: "Știu că nu îți mai dorești așa tare, că un podcast ți-a schimbat viața, dar ce cifre ți-au marcat ție ultimii ani din viață? Asta e simplă că vreau să vezi surpriza finală.",
    code: "911",
    reward: { type: "link", value: "https://youtube.com/shorts/7rGiMyys9kQ?si=ZyEsmkZ-qgRWap9I", label: "Deschide surpriza finală 🎁" }
  }
];

const KEY = "multi_unlock_progress_v4";
let progress = JSON.parse(localStorage.getItem(KEY) || "[]");
if(!Array.isArray(progress) || progress.length!==STAGES.length){ progress = STAGES.map(()=>false); }

const stageEl = document.getElementById('stage');
const progressEl = document.getElementById('progress');
const confetti = document.getElementById('confetti');

renderProgress();
renderStage(currentIndex());

function currentIndex(){ const i = progress.findIndex(done => !done); return i === -1 ? STAGES.length-1 : i; }
function renderProgress(){ progressEl.innerHTML = ""; progress.forEach(done=>{ const d=document.createElement('div'); d.className='dot'+(done?' done':''); progressEl.appendChild(d); }); }

function renderStage(i){
  const last = progress.every(Boolean);
  if(last){ stageEl.innerHTML = `<h2>🎉 Toate enigmele sunt rezolvate!</h2><p class="hint">Poți revedea surprizele sau reîncepe jocul.</p><div class="row"><button class="secondary" onclick="resetGame()">Resetează</button></div>`; return; }
  const s = STAGES[i];
  stageEl.innerHTML = `
    <span class="badge">Enigma ${i+1} din ${STAGES.length}</span>
    <h2>${s.title}</h2>
    <p class="hint">${s.hint}</p>
    <div class="row">
      <input id="code" type="password" autocomplete="off" placeholder="Scrie codul…"/>
      <button id="go">Deblochează</button>
    </div>
    <div id="fb" class="msg"></div>
    <div id="rw" class="reward" style="display:none"></div>
  `;
  document.getElementById('go').addEventListener('click', ()=>tryUnlock(i));
  document.getElementById('code').addEventListener('keydown', e=>{ if(e.key==='Enter') tryUnlock(i); });
}

function tryUnlock(i){
  const input=document.getElementById('code');
  const val=normalize(input.value); const good=normalize(STAGES[i].code);
  const fb=document.getElementById('fb'); const rw=document.getElementById('rw');
  if(!val){ fb.textContent='🔎 Introdu un cod.'; fb.className='msg bad'; return; }
  if(val===good){ 
    fb.textContent='✔️ Cod corect!'; fb.className='msg ok';
    showReward(rw, STAGES[i].reward);
    progress[i]=true; localStorage.setItem(KEY, JSON.stringify(progress));
    renderProgress(); if(i===STAGES.length-1) burstConfetti();
  } else { fb.textContent='❌ Cod greșit. Încearcă din nou.'; fb.className='msg bad'; shake(input); }
}

function showReward(container, reward){
  container.style.display='grid'; container.innerHTML='';
  if(reward.type==='link'){ const a=document.createElement('a'); a.href=reward.value; a.target='_blank'; a.textContent=reward.label||'Deschide surpriza 🎁'; container.appendChild(a); }
  else if(reward.type==='image'){ const img=new Image(); img.src=reward.value; img.alt='Surpriză'; container.appendChild(img); }
  else if(reward.type==='video'){ const v=document.createElement('video'); v.controls=true; v.src=reward.value; container.appendChild(v); }
  else { const p=document.createElement('p'); p.style.fontWeight='700'; p.textContent=reward.value; container.appendChild(p); }
  const nextIdx = progress.findIndex(done => !done);
  const btn=document.createElement('button'); btn.className='secondary'; btn.textContent = nextIdx===-1 ? 'Gata 🎉' : 'Următoarea enigmă →';
  btn.onclick = ()=>{ if(nextIdx===-1) renderStage(STAGES.length-1); else renderStage(nextIdx); };
  container.appendChild(btn);
}

function resetGame(){ progress = STAGES.map(()=>false); localStorage.setItem(KEY, JSON.stringify(progress)); renderProgress(); renderStage(0); }
function normalize(s){ return (s||'').toString().toLowerCase().replace(/\s+/g,''); }
function shake(el){ el.style.transition='transform .08s'; el.style.transform='translateX(4px)'; setTimeout(()=>{ el.style.transform='translateX(-4px)'; },80); setTimeout(()=>{ el.style.transform='translateX(0)'; },160); }

function burstConfetti(){
  for(let i=0;i<90;i++){ 
    const dot=document.createElement('div'); dot.style.position='fixed'; dot.style.width='10px'; dot.style.height='10px'; dot.style.borderRadius='50%';
    dot.style.left = Math.random()*100+'vw'; dot.style.top='-10px';
    dot.style.background = `hsl(${Math.floor(Math.random()*360)},80%,60%)`; dot.style.opacity=.9;
    document.querySelector('.confetti').appendChild(dot);
    const dur = 2000 + Math.random()*2000;
    const size = 6 + Math.random()*10; dot.style.width=size+'px'; dot.style.height=size+'px';
    const start = performance.now();
    requestAnimationFrame(function anim(t){ const p=(t-start)/dur; dot.style.transform = `translateY(${p*110}vh) rotate(${p*720}deg)`; dot.style.opacity = 1-p; if(p<1) requestAnimationFrame(anim); else dot.remove(); });
  }
}
</script>
